const trades = [
    {
        id: 1,
        text: 'Trade 1',
        sent: 'Chase',
        received: 'JJ',
    },
    {
        id: 2,
        text: 'Trade 2',
        sent: 'Chase',
        received: 'Three 1sts',
    },
    {
        id: 1,
        text: 'Trade 3',
        sent: 'Jacobs',
        received: 'Dalvin Cook + 2.09',
    }
]

const Trades = () => {
    return (
        <>
            {trades.map((trade) => (
                <h3 key={trade.id}>{trade.text}</h3>
            ))}
        </>
    )
}

export default Trades
